import React, { Component } from 'react';
import { MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBBtn } from 'mdb-react-ui-kit';



class LiveCard extends Component {

	render() {
		return (
			<MDBCard style={{ maxWidth: '22rem' }}>
				<MDBCardBody>
					<MDBCardTitle>{this.props.weather.name}</MDBCardTitle>
					<MDBCardText>
					<MDBCardText>Current {this.props.weather.main.temp}&deg;F <br></br>
                    </MDBCardText>
                    <MDBCardText>Highs {this.props.weather.main.temp_max}&deg;F <br></br>
                    </MDBCardText>
                    <MDBCardText>Lows {this.props.weather.main.temp_min}&deg;F <br></br>
                    </MDBCardText>        				</MDBCardText>
					<MDBBtn>Button</MDBBtn>
				</MDBCardBody>
			</MDBCard>
		);
	}
}


export default LiveCard;
